sparql:
PREFIX ling: <http://purl.org/linguistics#>
PREFIX geo: <http://www.opengis.net/ont/geosparql#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?name ?iso ?familyLabel ?lat ?long 
       (GROUP_CONCAT(DISTINCT ?featureLabel; SEPARATOR=", ") AS ?features)
WHERE {
    <https://glottolog.org/resource/languoid/id/abip1241> rdfs:label ?name ;
        ling:languageFamily/rdfs:label ?familyLabel ;
        geo:location/geo:lat ?lat ;
        geo:location/geo:long ?long .

    OPTIONAL { <https://glottolog.org/resource/languoid/id/abip1241> ling:iso639P3code ?iso }
    OPTIONAL {
        <https://glottolog.org/resource/languoid/id/abip1241> ling:hasFeaturePresent ?feature .
        ?feature rdfs:label ?featureLabel
    }
}
GROUP BY ?name ?iso ?familyLabel ?lat ?long

